def coin_change_min(coin_types, total):
    ways = [0] * (total + 1)
    ways[0] = 1
    for coin in coin_types:
        for j in range(coin, total + 1):
            ways[j] += ways[j - coin]
    return ways[total]

coin_types = [1, 5, 10, 25]
total = 63
print(coin_change_min(coin_types, total))
